        let currentTicker = null;
        let currentTab = 'today';

        window.onload = function() {
            const select = document.getElementById('tickerSelect');
            const tickers = Object.keys(marketData).sort();
            tickers.forEach(t => {
                const opt = document.createElement('option');
                opt.value = t;
                opt.innerText = t;
                select.appendChild(opt);
            });

            if (tickers.length > 0) {
                select.value = tickers[0];
                renderTicker();
            } else {
                document.getElementById('tableContainer').innerHTML = '<div class="p-5 text-center text-danger">No data found.</div>';
            }
        };

        function switchTab(tab) {
            currentTab = tab;
            document.querySelectorAll('.nav-link').forEach(l => l.classList.remove('active'));
            document.getElementById(tab + '-tab').classList.add('active');
            renderTable();
        }

        function renderTicker() {
            currentTicker = document.getElementById('tickerSelect').value;
            if (!currentTicker) return;

            const params = marketData[currentTicker].params || {};
            const pContainer = document.getElementById('priceDisplay');

            // Priority: Live Price > Excel Sample > Excel Price > 0
            let priceVal = params['live_price'] || params['ul_price_sample'] || params['ul_price'] || 0;
            let priceSource = params['live_price'] ? 'Live' : 'Excel';

            pContainer.innerHTML = `
                <div class="info-tag">
                    <span class="text-muted small">Price:</span>
                    <span class="info-val text-success">$${parseFloat(priceVal).toFixed(2)}</span>
                </div>
                <div class="info-tag d-none d-md-flex">
                    <span class="text-muted small">Source:</span>
                    <span class="info-val" style="font-weight:normal;">${priceSource}</span>
                </div>
            `;
            renderTable();
        }

        function renderTable() {
            if (!currentTicker) return;
            const dataObj = marketData[currentTicker][currentTab];
            const container = document.getElementById('tableContainer');

            if (!dataObj || !dataObj.data || dataObj.data.length === 0) {
                container.innerHTML = '<div class="d-flex align-items-center justify-content-center h-100 text-muted">No data available for this view.</div>';
                return;
            }

            const rows = dataObj.index; 
            const cols = dataObj.columns; 
            const values = dataObj.data; 

            const params = marketData[currentTicker].params || {};
            const currentPrice = parseFloat(params['live_price'] || params['ul_price_sample'] || params['ul_price'] || 0);

            let closestIdx = -1;
            let minDiff = Infinity;

            cols.forEach((s, i) => {
                const cleanS = String(s).replace(/[^0-9.]/g, '');
                const strikeVal = parseFloat(cleanS);
                if (!isNaN(strikeVal) && currentPrice > 0) {
                    const diff = Math.abs(strikeVal - currentPrice);
                    if (diff < minDiff) {
                        minDiff = diff;
                        closestIdx = i;
                    }
                }
            });

            let maxVal = 0;
            values.forEach(r => r.forEach(v => { if(v > maxVal) maxVal = v; }));

            let html = '<table class="table table-sm table-hover mb-0">';
            html += '<thead><tr><th class="expiry-cell">Expiry \ Strike</th>';
            cols.forEach((col, i) => {
                const isClosest = (i === closestIdx);
                const cls = isClosest ? 'header-cell closest-header' : 'header-cell';
                const idAttr = isClosest ? 'id="targetColumn"' : '';
                html += `<th class="${cls}" ${idAttr}>${col}</th>`;
            });
            html += '</tr></thead><tbody>';

            rows.forEach((expiry, rIdx) => {
                html += `<tr><td class="expiry-cell">${expiry}</td>`;
                values[rIdx].forEach((val, cIdx) => {
                    let displayVal = val;
                    if (val === null || val === undefined) displayVal = 0;

                    let alpha = 0;
                    if (maxVal > 0 && displayVal > 0) alpha = Math.sqrt(displayVal / maxVal);
                    if (alpha > 1) alpha = 1;

                    const bg = `rgba(40, 167, 69, ${alpha.toFixed(2)})`;
                    const color = alpha > 0.5 ? 'white' : 'black';
                    const isClosest = (cIdx === closestIdx);
                    const cellClass = isClosest ? 'cell-val closest-strike' : 'cell-val';

                    html += `<td class="${cellClass}" style="background-color: ${bg}; color: ${color};" title="${displayVal}">${Math.round(displayVal).toLocaleString()}</td>`;
                });
                html += '</tr>';
            });
            html += '</tbody></table>';

            container.innerHTML = html;

            setTimeout(() => {
                const target = document.getElementById('targetColumn');
                if (target) {
                    target.scrollIntoView({ behavior: 'auto', block: 'nearest', inline: 'center' });
                }
            }, 100);
        }
    </script>
